import React from 'react';
import { Container } from '@material-ui/core';
import Post from './Post/Post';

const Posts = () => {
    return (
        <Container>
            <h1>Posts</h1>
            <Post imageSource = "client/public/logo512.png"/>
        </Container>
    );
};

export default Posts;
